import React, { useState } from "react";
import { RadioButtonGroup, RadioButton } from "carbon-components-react";
import "../../public/calidad.css";
import "../../public/styles.css";
import About from "./About.jsx";
import Home from "./Home.jsx";

let variable = true;

const Dark = "";
const Light = "";

function Bg() {
  const [backGround, setBg] = useState("black");

  const handleDark = () => {
    setBg("black");
  };
  const handleLight = () => {
    setBg("#fff");
  };

  return (
    <div style={{ background: "#434546" }}>
      <RadioButtonGroup
        name="radio-button-group"
        defaultSelected="radio-1"
        onChange={(x) => {
          console.log(x);
          {
            x === "Dark" ? handleDark() : "none";
          }
          {
            x === "Light" ? handleLight() : "none";
          }
        }}
      >
        <RadioButton
          className="bgRadioBtn"
          labelText="Dark"
          value="Dark"
          id="radio-1"
        />
        <RadioButton
          className="bgRadioBtn"
          labelText="Light"
          value="Light"
          id="radio-2"
        />
      </RadioButtonGroup>
      <div style={{ background: backGround }}>
        {variable ? <About /> : <Home />}
      </div>
    </div>
  );
}

function List() {
  return <Bg />;
}

export default List;
